INSERT INTO `setting` VALUES (7, 'information', 'textarea', 'We are one of the trust-able car exporter in Singapore, serving clients all over the world such as Africa, Caribbean, America, Europe, Asia, Oceania and many more. We sell brand-new as well as used-car from Singapore as per our clients requests. Give us your specifications and we will find the car for you. We value long-term working relationships with all of our clients who are the utmost importance to our business. Our reputation, ethics, and integrity are the main integral parts in our business which you will feel rest assured when dealing with us.');
INSERT INTO `setting` VALUES (8, 'contact', 'textarea', 'Contact Optimus Auto Trading Pte. Ltd.<br>\r\nAddress: 33 Ubi Avenue 3, Vertex Singapore 408868<br><br>\r\n\r\nPhone: +65 9751 0199 | +65 9898 7565 <br>\r\nEmail: info@optimusautotrading.com <br>\r\nBusiness Hours: 9:00 AM - 6:00 PM <br>\r\nSaturday, 9:00 AM - 12:00 PM. Closed on Sunday.\r\n');
